using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class BottomOutputModel : Notifier	{		public BottomOutputModel()		{					ShellThk = "";			OutSideProjection = "";			InsideProjection = "";			ODTwo = "";			BottomSlopAngle = "";			OverlapOfAnnular = "";		}				private string _ShellThk;		public string ShellThk			{				get { return _ShellThk; }				set				{					_ShellThk = value;					OnPropertyChanged(nameof(ShellThk));				}			}				private string _OutSideProjection;		public string OutSideProjection			{				get { return _OutSideProjection; }				set				{					_OutSideProjection = value;					OnPropertyChanged(nameof(OutSideProjection));				}			}				private string _InsideProjection;		public string InsideProjection			{				get { return _InsideProjection; }				set				{					_InsideProjection = value;					OnPropertyChanged(nameof(InsideProjection));				}			}				private string _ODTwo;		public string ODTwo			{				get { return _ODTwo; }				set				{					_ODTwo = value;					OnPropertyChanged(nameof(ODTwo));				}			}				private string _BottomSlopAngle;		public string BottomSlopAngle			{				get { return _BottomSlopAngle; }				set				{					_BottomSlopAngle = value;					OnPropertyChanged(nameof(BottomSlopAngle));				}			}				private string _OverlapOfAnnular;		public string OverlapOfAnnular			{				get { return _OverlapOfAnnular; }				set				{					_OverlapOfAnnular = value;					OnPropertyChanged(nameof(OverlapOfAnnular));				}			}			}}